fulfill all movements (1-7):

Movement 1: a) Touch Button: touch four virtual buttons with right hand in the air (start left-right-diagonal left, down); b) Touch Button: touch four virtual buttons with left hand in the air (start right-left-diagonal right, down);

Movement 2: a) Drag and Drop: drag with right hand in the air (start left-to right), drag with right hand in the air (start top to buttom), drag with right hand in the air (start front to chest); b) Drag and Drop: drag with left hand in the air (start right to left); drag with left hand in the air (start top to buttom); drag with left hand in the air (start front to chest);
Movement 3: a) Zoom: zoom in with both hands (start front to side) b) Zoom: zoom out with both hands diagnoal (start front to diagonal up/down)
Movement 4: a) Circular movement: with both hands, formed as fists, start in front of the person, form circles upwards two times; b) Circular movement: with both hands, formed as fists, start in front of the person, form circles downwards two times;
Movement 5: a) Pick up Object: Pick up object with the left hand from the left side to the middle, switch hands, place object with right hand to the right side; b) Pick up Object: Pick up object with the right hand from the right to the middle, switch hands, place object with left hand to the left side;
Movement 6 (fulfill a-b-c-d-a-b-c-d: a) Movement: bend both lower arms 90° to the front b) Movement: bend both whole arms 90° to the front c) Movement: bend both whole arms 90° to the side d) Movement: wave with lower arms next to the head two times;
Movement 7: Mix: push two buttons with the right hand (middle-diagonal right), drag one object from front to chest, zoom in with both hands two times, push two buttons with the right hand (middle-diagonal right), form circles upwards two times, drag object from chest to front, push two buttons with the right hand (middle-diagonal right)
